import React, { Component } from "react";
import { Link } from "react-router-dom"


export default class TaskTable extends Component {

    

    constructor(props) {
        super(props);

      

        this.state = {
            accounts : []
        }
    }

    componentDidMount(){         
        this.state.accounts = JSON.parse(localStorage.getItem("accounts"));      
        
        // this.state.accounts &&
        //  JSON.parse(localStorage.getItem()); 
               
      }
 
    render() {
        

        var col = this.state.accounts && this.state.accounts.map((account,index) => {
            return (  
        <th scope="col">{account.account}</th>
        )})

        return (

             
        <table class="table">
         
        <thead >
       
            <tr>
            <th >#</th>
           
            </tr>
            
        </thead>
      
        <tbody>
            <tr>
            <th scope="row"></th>

            {this.state.accounts && this.state.accounts.map((account,index) => {
                return (  
           <td>{account.email}</td>  
            )})}
                      
            </tr>
            <tr>                       
            </tr> 
        </tbody>
     
        </table>
  
        );
    }
}
